import React from "react";
import "./Banner.css";

function Banner() {
  return (
    <div className="banner">
      <div
        style={{
          width: "70%",
          display: "flex",
          justifyContent: "center",
          backgroundColor: "rgba(43,42,41,255)",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "space-evenly",
            width: "60%",
            textAlign: "center",

            color: "#fff",
          }}
        >
          <p>Best Sellers</p>
          <p>Gift Ideas</p>
          <p>New Releases</p>
          <p>Today's Deals</p>
          <p>Customer Service</p>
        </div>
      </div>
    </div>
  );
}

export default Banner;
